package com.eightbit85.monnn.cate

import cats.implicits.catsKernelStdEqForList
import cats.instances.double._
import cats.instances.int._
import cats.kernel.laws.discipline.MonoidTests
import cats.syntax.semigroup._
import com.eightbit85.monnn.cate.Implicits._
import org.scalacheck.Arbitrary.arbitrary
import org.scalacheck.Gen
import org.scalacheck.Prop._

class ElemWiseListMonoidTests extends munit.DisciplineSuite {

  override val scalaCheckInitialSeed = "PpFHD-2gsCkTO-aiqXSC0PeAh9FdePppsBC1Pf000fP=" // See below

  def matrix[T](g: Gen[T]): Gen[List[List[T]]] = Gen.sized { size =>
    val side = scala.math.sqrt(size).asInstanceOf[Int]
    Gen.listOfN(side, Gen.listOfN(side, g))
  }

  val mtxGen: Gen[(List[List[Double]], List[List[Double]])] = for {
    m1 <- matrix(arbitrary[Double])
    m2 <- matrix(arbitrary[Double])
  } yield (m1, m2)

  property("ElemWiseListMonoid.Behavior combines Lists of monoids by combining elements from each list in order") {
    forAll(mtxGen) { case (m1, m2) =>
      if (m1.isEmpty && m2.isEmpty) (m1 |+| m2).isEmpty
      else (m1 |+| m2).head.head == m1.head.head + m2.head.head
    }
  }

